import React from "react";

import Button from './Button'
import { items } from "../UI/data/Items";


const Card = props => {
    console.log(items)

    return (
        <div>
            <div>
                <ul>
                    {items.map(items => {
                        return (
                            <li>
                                <div>
                                    <img ></img>
                                {items.name}
                                </div>
                            </li>)
                    })
                    }
                </ul>
            </div>
            <Button />
        </div>
    )

};

export default Card;
